import { useState } from 'react';
import './App.css';

function App() {
  const [name,setName]=useState(0);
  function Increase(){
      setName(name+1);
  }
  return (
    <>
        <div>
          <h1>${name}</h1>
          <button onClick={Increase}>+</button><button>-</button>
        </div>
    </>
  );
}

export default App;
